import React from 'react';
import s from './Support.module.css';
import {NavLink} from "react-router-dom";

import vk from './VK.svg';
import mail from './mail.svg';
import whatsapp from './whatsapp.svg';

const Support = () => {
  return (
      <div className={s.supp__window}>
        <div className={s.supp__background}/>

        <div className={s.supp__modal}>
          <div className={s.supp__content}>

          </div>
            <div className={s.supp_btn}>
              <div className={s.supp_btn_content}>
                <NavLink className={s.btn__text} to={'/'}>Почта</NavLink>
                <img src={vk} alt=""/>
              </div>
            </div>
        </div>
      </div>
  );
};

export default Support;
